import React from "react"

const Contact = () => {
    return (
        <div class="contact">
            <h2>Contact</h2>
            <p class="name">Bucataru Cristian</p>
            <p class="name">Hrib Ecaterina</p>
            <p class="name">Roca Dominic</p>
            <p class="name">Blajut Cristin</p>
        </div>
    )
}

export default Contact;
